import { observer } from "mobx-react";
import React from "react";
import "../../styles/RegistrationPage.css";
import { store } from "../stores/AuthStore"

const Auth = observer(() => {
    return (
        <div className="RegistrationPage">
          <div className="RegistrationHeader">
            <p>
              Авторизация 
            </p>         
          </div>
          <div className="MainWindowRegistration">
            <div>
              <p>
                Enter your Email:
              </p>
              <input className="Input"
                value={store.email}
                onChange = { (text) => store.setEmail(text)}
                // placeholder="Enter email..."
                />
            </div>
            <div>
              <p>
                Enter your Password:
              </p>
              <input className="Input"
                type="text"
                value={store.password}
                // onChange={ text => store.setPassword(text)}
                // placeholder="Enter password..."
                />
            </div>
            <button variant="success" name="accept">Accept</button>
            <button variant="success" name="registration">Registration</button>
          </div>
        </div>
      );


})

export default Auth;
